import Link from "next/link";
import styled from "styled-components";
import Button from "../Button/Button";

const NavbarOption = styled.Link`
  border: none;
  font-weight: bold;
  line-height: 18px;
  transition: all 350ms;

  &:hover {
    border-bottom: hsla(319, 100%, 57%, 1);
  }
`;

const Navbar = () => (
  <div>
    <ul>
      <li>
        <NavbarOption href="/">Home</NavbarOption>
      </li>
      <li>
        <NavbarOption href="/about">About</NavbarOption>
      </li>
    </ul>
    <style jsx>{`
      ul {
        background: #333;
        color: #fff;
        list-style: none;
        display: flex;
      }

      ul li {
        font-size: 18px;
        margin-right: 20px;
      }

      ul li a {
        color: #fff;
        text-decoration: none;
      }
    `}</style>
  </div>
);

export default Navbar;
